import React, {Component} from 'react';
import styled from 'styled-components';
import {Navbar, Nav, NavItem} from 'react-bootstrap';
import logo from '../assets/giftly-logo-header.png';

const Container = styled.div`
  background: #F0EFE7;
  color: #65543C;
  clear: both;
  height: 60px;

  .navbar-brand {
    padding: 0 8px;
  }

  .card-name {
    position: relative;
    top: 20px;

  }
`

const BreadcrumbsContainer = styled.div`
  padding: 4px 20px;
  color: #A3BCC1;
  font-size: 16px;
  margin-bottom: 30px;
`

const NavbarHeader = styled.div`
  width: 400px;
  float: left;
`

const NavbarRight = styled.div`
  width: 400px;
  float: right;
  .nav-item {
    float: left;
    padding: 20px;
  }
`

class Header extends Component {
  render() {
    return (
      <Container className="header">
        <Navbar>
          <NavbarHeader>
            <Navbar.Brand>
              <img alt="" src={logo} />
            </Navbar.Brand>
            <div className="card-name">
              {this.props.business.name} Gift Card
            </div>
          </NavbarHeader>
          <NavbarRight>
            <Nav>
              <NavItem href="#">
                Browse
              </NavItem>
              <NavItem href="#">
                Corporate Gifts
              </NavItem>
            </Nav>
          </NavbarRight>
        </Navbar>
      </Container>
    );
  }
}

class Breadcrumbs extends Component {
  render() {
    return (
      <BreadcrumbsContainer>
        Gift Cards > San Fancisco > Restaurants > American > Zuni Caf√©
      </BreadcrumbsContainer>
    );
  }
}

export { Header, Breadcrumbs };
